import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () =>{
    return(
        <div style={{
            position: "absolute",
            left: "0%",
            right: "0%",
            top: "0%",
            bottom: "0%",
        background: "#4C88FF",
        boxShadow: "0px 4px 4px rgba(0 0 0 0.25)",
        height:"50px",
        borderRadius: "0px 0px 7px 7px"
        }}>
        </div>
    );
}
export default Navbar
